import Layout from '../components/Layout';
import Link from 'next/link';
import myImg from './my-image.jpg' 

const Index = () => {
    return (
        <Layout>
            <h2>Index page</h2>
            <div>
  <img src={myImg} />
</div>
            <Link href="/signup">
                <a>Signup</a>
            </Link>
        </Layout>
    );
};

export default Index;
